import React, { Component } from 'react';
import '../website.css';
import warren from '../images/warren.JPG';


class Home extends Component {
    constructor(props) {
        super(props);
        this.routeToExp = this.routeToExp.bind(this);
      }

    routeToExp() {
        const path = '/experiences';
        this.props.history.push(path);
    }
    render() {
        return (
            <div className="Home">
                <div className="home_page">
                    <div className="my_info">
                        <p>HI! I'm</p>
                        <div className="name">
                            <p>WARREN WANG</p>
                        </div>
                        <p>EECS MAJOR @ BERKELEY | FULL-STACK DEVELOPER</p>
                    </div>
                    <div className="container">
                        {/* <div className="portrait"> */}
                            <img className="image" src={warren} />
                        {/* </div> */}
                        <div className="overlay">
                            <p onClick={()=>this.routeToExp()} className = "text">EXPERIENCES</p>
                            <p className = "text">PROJECTS</p>

                        </div>
                    </div>

                </div>

            </div>
        );
    }
}

export default Home;
